import './statics/css/appFooter.css'
import {useCallback} from 'react'

var AppFooter = props=>{

    let document_scrollHeight = document.documentElement.scrollheighpxt

    let positioningFooter = useCallback(el=>{
        console.log(el)
        el.style.top = `${document_scrollHeight}px`
    })


    return (
        <div className="footer" ref = {el=>positioningFooter(el)} >

        </div>
    )
}

export default AppFooter;
